import React from 'react';
import { Route, Switch } from 'react-router-dom';
import SignUp from './components/signup';
import CreatorTypeform from './components/CreatorTypeform'; // Import your new component

const App = () => {
  return (
    <div className="app">
      <h1>Sign Up</h1>
      <Switch>
        <Route path="/creator-typeform" component={CreatorTypeform} />
        <Route path="/" component={SignUp} />
      </Switch>
    </div>
  );
};

export default App;
